import styled from 'styled-components'

export const HeaderStyle = styled.header`
    background: #ffce00;
    height: 75px;
    border-bottom: 1px solid #DDD;
	position: relative;
    box-sizing: border-box;

    .header-content {
        width: 100%;
        max-width: 980px;
        margin: 0 auto;
        height: 75px;
        padding: 0 30px;

        display: flex;
        align-items: center;
        justify-content: space-between;

        .logo {
            height: 70px;
        }
    }
`
